SET NOCOUNT ON;
DECLARE @AAH_GIS_DISTRICTS TABLE (
    [OBJECTID] [int] NOT NULL,
    [DIST_ABRVN] [nvarchar] (3) NULL,
    [DIST_NBR] [int] NULL,
    [DIST_NM] [nvarchar] (20) NULL,
    [Shape__Area] [numeric] (38, 8) NULL,
    [Shape__Length] [numeric] (38, 8) NULL,
    [SHAPE] [geometry] NULL,
    [GDB_GEOMATTR_DATA] [varbinary] (max) NULL
        );


--insert new records, not null fields only
SELECT DISTINCT t1.OBJECTID
FROM @AAH_GIS_DISTRICTS t1
    LEFT JOIN [gis].[AAH_GIS_DISTRICTS] t2 ON t1.OBJECTID = t2.OBJECTID
WHERE t2.OBJECTID IS NULL

-- update other fields
UPDATE [gis].[AAH_GIS_DISTRICTS]
SET 
DIST_ABRVN=t2.DIST_ABRVN,
DIST_NBR=t2.DIST_NBR,
DIST_NM=t2.DIST_NM,
Shape__Area=t2.Shape__Area,
Shape__Length=t2.Shape__Length,
SHAPE=t2.SHAPE,
GDB_GEOMATTR_DATA=t2.GDB_GEOMATTR_DATA
FROM @AAH_GIS_DISTRICTS t2
    LEFT JOIN [gis].[AAH_GIS_DISTRICTS] t1 ON t1.OBJECTID = t2.OBJECTID

